pinpad = [
    [None, None, '1', None, None],
    [None, '2', '3', '4', None],
    ['5', '6', '7', '8', '9'],
    [None, 'A', 'B', 'C', None],
    [None, None, 'D', None, None],
]

loc = [2,0]

hidden_code = '''





'''
hidden_code = hidden_code.strip().split('\n')

directions = {
    'U': (-1, 0),
    'D': (1, 0),
    'L': (0, -1),
    'R': (0, 1),
}

code = []
for line in hidden_code:
    for direction in line:
        offset = directions[direction]
        loc[0] = min(4, max(0, loc[0]+offset[0]))
        loc[1] = min(4, max(0, loc[1]+offset[1]))
        if pinpad[loc[0]][loc[1]] is None:
            loc[0] = min(4, max(0, loc[0]-offset[0]))
            loc[1] = min(4, max(0, loc[1]-offset[1]))
        print(pinpad[loc[0]][loc[1]], end='')
    print()
    print(line)
    code.append(pinpad[loc[0]][loc[1]])

print(''.join(code))
